window.bookSummaryJSON = "<p>Show no weakness. Yield no mercy.</p> <p>Jade may have survived her wedding night in the ruthless kingdom of Rewyth, but her battle is far from over.</p> <p>Thrown into yet another new world, Jade is forced to fight between her heart and her intuition as humans and fae pull her in opposite directions. Jade is no longer the only human in sight, yet she finds herself defending the fae more and more.</p> <p>Malachi's life is thrown into a spiral as he learns more about his father's lies, his mother's secrets, and his wife's destiny. He is willing to protect Jade at all costs, even if she's in more danger with every passing day. Fighting his instincts as the Prince of Shadows, Malachi is forced to submit to human ruling, following his mother's plan to unite humans and fae and create peace in the human kingdom of Fearford.</p> <p>Jade and Malachi's journey continues in Prince of Sins and Shadows as new enemies, ancient prophecies, and mythical creatures threaten them every step of the way. Will their bond defy the true nature of who they really are? Or will they succumb to the strong forces that pull them apart?</p>"; 
